import React from 'react';
import { Row, Col, Container, Carousel, Button, Image } from 'react-bootstrap';

function Calculator() {
  return (
    <div className='Calculator'>
      <Row>
        <Col>
        <h1>Insurance calculator</h1>
        </Col>
      </Row>
      <Row>
        <Col>
        <h3>View our plans.</h3>
        </Col>
      </Row>
    </div>
  );
}

export default Calculator;
